import React from "react";
import "../stylesheets/options.css";

const Options = () => {
  let move = () => {};

  return (
    <div className="OPMainDiv">
      <div className="OPOptions">
        <span
          className="OPA"
          onClick={() => {
            move("OPA");
          }}
        >
          2.56
        </span>
        <span
          className="OPB"
          onClick={() => {
            move("OPA");
          }}
        >
          2.56
        </span>
        <span
          className="OPC"
          onClick={() => {
            move("OPA");
          }}
        >
          2.56
        </span>
        <span
          className="OPD"
          onClick={() => {
            move("OPA");
          }}
        >
          2.56
        </span>
      </div>
      <div className="OPButtonDiv">
        <div className="OPButtonDiv">
          <button className="OPNextButton">Next</button>
        </div>
      </div>
    </div>
  );
};

export default Options;
